import React from 'react';
import './Prize.css';

class Prize extends React.Component {
  constructor(props) {
    super(props);
  }

  render(){
  	return(
  		<div className="prize-container">
  			<div className="tctfl main-title">
  				Prize
  			</div>
        <ul className="timeline-content-container">
          <li>
            <div className="tctfl qualification-content">
            Yuga Onoue, (2021). Science Incare 2021. Ministry of Education, Culture, Sports, Science and Technology.
            </div>
          </li>
        </ul>
  		</div>
  	);
  }
}

export default Prize;
